.concatUs{
	width: 50px;
	background-color: #e64254;
	border-radius: 4px 0 0 4px;
	position: fixed;
	top: 50%;
	right: 0;
	z-index: 999;
	transform: translateY(-50%)
}

.concatUs>div{
	height: 48px;
	position: relative;
	text-align: center;
	line-height: 48px
}

.concatUs>div:after {
	content: "";
	height: 1px;
	border-bottom: 1px solid hsla(0, 0%, 100%, .651);
	position: absolute;
	width: 50%;
	top: 0;
	left: 50%;
	transform: translateX(-50%)
}

.concatUs>div:first-of-type:after {
	content: "";
	height: 0;
	border: none
}

.concatUs>div img{
	vertical-align: middle;
	width: 20px
}

.concatUs>div .hoverDiv{
	position: absolute;
	background-color: #e64254;
	top: 0;
	left: 0;
	height: 100%;
	line-height: 48px;
	text-align: left;
	padding-left: 50px;
	padding-right: 15px;
	color: #fff;
	transition: all .5s
}

.concatUs>div .hoverDiv a{
	color: #fff
}

.concatUs>div .hoverDiv img{
	position: absolute;
	left: 14px;
	top: 50%;
	transform: translateY(-50%)
}

.concatUs>div .hoverDiv:hover {
	transform: translateX(calc(-100% + 50px))
}

.concatUs>div .hoverDiv span{
	white-space: nowrap
}

